import React, { Component } from 'react';
import { Modal, ModalHeader, ModalBody, ModalFooter, Alert, Button, Card, CardBody, Col, Container, Form, Input, InputGroup, InputGroupAddon, InputGroupText, Row } from 'reactstrap';
import { login } from '../../../api/functions/UserFunctions'

class Login extends Component {

  constructor() {
     super()
     this.state = {
       email: '',
       password: '',
       errors: {},
       show: false
     }

     this.onChange = this.onChange.bind(this)
     this.onSubmit = this.onSubmit.bind(this)
   }

   onChange(e) {
     this.setState({ [e.target.name]: e.target.value })
   }

   showPopUp = (show) => {
     if (show === true)
     return(
       <div>
        <Modal isOpen={this.state.show}>
          <ModalHeader>Erreur d'authentification</ModalHeader>
          <ModalBody>
            <strong> Veuillez saisir la bonne adresse e-mail et le bon mot de passe </strong>
            <br/>
            <br/>
            Veuillez saisir la bonne adresse e-mail et le bon mot de passe
            <br/>
            <br/>
          </ModalBody>
          <ModalFooter>
              <Button color="secondary" onClick={() => this.changeShowState()}>Annuler</Button>
          </ModalFooter>
        </Modal>
      </div>
    )
  }

    changeShowState = () => {
      this.setState({
        show: !this.state.show
      })
    }

   onSubmit(e) {
     e.preventDefault()

     const user = {
       email: this.state.email,
       password: this.state.password
     }

   login(user).then(res => {
     if (res) {
       this.props.history.push(`/Signals`)
     } else {
       console.log("ELSEEEEEEEEEEEEE");
       this.changeShowState()
     }
   })
 }

render() {
  return (
    <div className="app flex-row align-items-center">
      {this.showPopUp(this.state.show)}
      <Container>
        <Row className="justify-content-center">
          <Col md="9" lg="7" xl="6">
            <Card className="mx-4">
              <CardBody className="p-4">
                <Form noValidate onSubmit={this.onSubmit}>
                  <h1>S'identifier</h1>
                  <InputGroup className="mb-3">
                    <InputGroupAddon addonType="prepend">
                      <InputGroupText>@</InputGroupText>
                    </InputGroupAddon>
                    <Input
                    type="text"
                    placeholder="Email"
                    name="email"
                    value={this.state.email}
                    onChange={this.onChange}
                    required
                    />
                  </InputGroup>
                  <InputGroup className="mb-3">
                    <InputGroupAddon addonType="prepend">
                      <InputGroupText>
                        <i className="icon-lock"></i>
                      </InputGroupText>
                    </InputGroupAddon>
                    <Input
                    type="password"
                    placeholder="Mot de passe"
                    autoComplete="new-password"
                    name="password"
                    value={this.state.password}
                    onChange={this.onChange}
                    required/>
                  </InputGroup>
                  <Button color="success" type="submit" block>Se connecter</Button>
                </Form>
              </CardBody>
              </Card>
          </Col>
        </Row>
      </Container>
    </div>
        );
    }
}

export default Login;
